      "description": "'Good Luck With That is a lesson in kindness, acceptance, and self-worth. I'm so glad I read this book, and I hope every woman gives herself this gift' Reader review ---- Emerson, Georgia, and Marley have been best friends ever since they met at a weight-loss camp as teens. When Emerson tragically passes away, she leaves one final wish for her best friends: to conquer the fears they still carry as adults. For each of them, that means something different. For Marley, it's coming to terms with the survivor's guilt she's carried around since her twin sister's death, which has left her blind to the real chance for romance in her life. For Georgia, it's about learning to stop trying to live up to her mother's and brother's ridiculous standards, and learning to accept the love her ex-husband has tried to give her. But as Marley and Georgia grow stronger, the real meaning of Emerson's dying wish becomes truly clear: more than anything, she wanted her friends to love themselves. A novel of compassion and insight, Good Luck With That tells the story of two women who learn to embrace themselves just the way they are. ---- Real readers have fallen in love with Good Luck with That 'A must read from the very talented Kristan Higgins, who just gets better and better with each book she writes' 5 star reader review 'What a book! Tears were flowing at the end' 5 star reader review 'If ever there was a book that demands to be discussed, it's this one. I wish I were part of a book club because Good Luck with That is the one I'd demand everyone read' 5 star reader review 'Wonderful story. I would highly recommend' 5 star reader review 'The people in this book caught hold of my heart and interest from the first few pages. Finished in three evenings and was sorry when it came to an end. Many a tear both sad and happy' 5 star reader review",
